import "./BodyRow.css";

// TODO make this generalizable so that can feed in list of items and header title

const BodyRow: React.FC = () => {
  return (
    <div>
      <div className="header-title">Tinkering</div>
      <div className="items">
        <div className="coming-soon-block"></div>
      </div>
    </div>
  );
};

export default BodyRow;
